import React from 'react'
import FeedTextBox from './FeedTextBox'

function Cuerpostreams(props) {
    return(
        <div className="col-12">
                          {
                              props.info.map((infoClips) => {
                                  return(
                                  <FeedTextBox clipId={infoClips} />
                                  )
                              })
                          }
                     </div>
    )
}
export default Cuerpostreams
